import React from 'react';
import './cards.css';

function CardItem(props) {
    const min = 200;
    const max = 2000;
    const min1 = 0.01;
    const max1 = 4.99;

    var randomPrice = min + Math.random() * (max - min);
    randomPrice = Math.round(randomPrice * 100) / 100;
    var randomPercent = min1 + Math.random() * (max1 - min1);
    randomPercent = Math.round(randomPercent * 100) / 100;

    var priceHigh = randomPrice + (3 + Math.random() * (20 - 3));
    priceHigh = Math.round(priceHigh * 100) / 100;
    var priceLow = randomPrice - (3 + Math.random() * (20 - 3));
    priceLow = Math.round(priceLow * 100) / 100;

    var PE = 15 + Math.random() * (100 - 15);
    PE = Math.round(PE * 100) / 100;

    const alphabet = 'abcdefghijklmnopqrstuvwxyz';
    const randomCharacter = alphabet[Math.floor(Math.random() * alphabet.length)].toUpperCase();

    // eslint-disable-next-line no-useless-concat
    const objData = '{"name":"'+props.text+'"}';

    if(props.text[0] > randomCharacter){
        return (
            <>
                <li className='cards__item'>
                    <div className='cards__item__link'>
                        <div className='cards__item__info'>
                            <h5 className='cards__item__text'>{props.counter}. {props.text}</h5>
                            <p className='p_stock_price_down'>{ randomPrice } &nbsp; -{ randomPercent }%</p>
                        </div>
                    </div>
                </li>
            </>
        );
    } else {
        return (
            <>
                <li className='cards__item'>
                    <div className='cards__item__link'>
                        <div className='cards__item__info'>
                            <h5 className='cards__item__text'>{props.text}</h5>
                            <p className='p_stock_price_up'>{ randomPrice } &nbsp; +{ randomPercent }%</p>
                        </div>
                    </div>
                </li>
            </>
        );
    }

}

export default CardItem;
